function menu(){"use strict";var e=document.getElementById("nav-button-bar"),s=document.getElementById("nav-list");-1===e.className.indexOf("bar-closed")?(e.className=e.className.replace("bar-open","bar-closed"),s.className=s.className.replace("list-open","list-closed")):(e.className=e.className.replace("bar-closed","bar-open"),s.className=s.className.replace("list-closed","list-open"))}function jumpTop(){"use strict";document.body.scrollTop=0,document.documentElement.scrollTop=0}window.onscroll=function(){"use strict";var e=document.getElementById("nav-bar");document.body.scrollTop>100||document.documentElement.scrollTop>100?(e.className="sticky",document.getElementById("jump-top").style.display="block"):(e.className=e.className.replace("sticky","top"),document.getElementById("jump-top").style.display="none")};